import React, { Component } from 'react'
import MapContainer from '../../Parts/Maps/Maps'

import './Card.css'

class ContactUsCard extends React.Component {
    constructor(props){
        super(props);
      }
      state = {
        isOpen: false
      };

      openModal = () => this.setState({ isOpen: true });
      closeModal = () => this.setState({ isOpen: false });
    render() {
        return (
            <div class="card carditem text-center rounded  col-md-3 col-sm-12 mr-2 txtFont">
                <div dangerouslySetInnerHTML={{__html:this.props.item.txt}}></div>
                <button onClick={MapContainer}> Press me to print a message! </button>
            </div>
        )
    }
}

export default ContactUsCard;
